						<textarea id="docsrc" style="display:none">The Reference Archietecture for Nordic Smart Government

The detailed objects in the model are under "model content", while archimate views are under "views". Good places to start are:
* Views - Business processes, functions and roles - Business Roles - Roles
* Views - Application functions, processes - Application processes - Accounting
* Views - Information architecture 
* Views - Application functions, processes - Application processes - Analysis
